export const HowItWorks = () => {
  return (
    <S.HowItWorksWrapper>
      <S.Content>
        <div>
          <div>Title</div>
          <div>Subtitle</div>
        </div>

        <div>
          <div>1</div>
          <div>2</div>
          <div>3</div>
        </div>
      </S.Content>
    </S.HowItWorksWrapper>
  );
};
